import * as React from "react";
// import styles from "./SpFxWebpartSalesTools.module.scss";
// import type { ISpFxWebpartSalesToolsProps } from "./ISpFxWebpartSalesToolsProps";
// import { escape } from "@microsoft/sp-lodash-subset";
import { LearningDataService } from "../../../services/LearningDataService";
import type { ISpFxWebpartOnboardingProps } from './ISpFxWebpartOnboardingProps';
import '../../../../assets/dist/tailwind.css';
import ProgressBar from './ProgressBar';
import OnboardingListCourses from './OnboardingListCourses';
import { useEffect, useState, useRef } from 'react';
// import { AadHttpClient } from '@microsoft/sp-http';
import CoursesBoard from './popup/CoursesBoard';
import { OnboardingData } from "./ISpFxWebpartOnboardingProps";
import { CourseRow } from "./ISpFxWebpartOnboardingProps";

const SpFxWebpartOnboarding: React.FC<ISpFxWebpartOnboardingProps> = (props) => {
  const { onboardingId } = props;
  const dataService = LearningDataService.getInstance();
  const [data, setData] = useState<OnboardingData | null>(null);

  useEffect(() => {
    const handleDataResponse = (responseData: OnboardingData): void => {
      setData(responseData);
    };

    const waitForProvider = (): void => {
      console.log(`Registering listener for sp-data/4sp/${onboardingId}`);
      // Listen for data responses
      dataService.on(`sp-data/4sp/${onboardingId}`, handleDataResponse);

      console.log(`Emitting event: requestData for sp-data/4sp/${onboardingId}`);
      // Request for data from the provider
      dataService.emit("requestData", `sp-data/4sp/${onboardingId}`);
    }

    if ((dataService as any)._events?.requestData) {
      waitForProvider();
    } else {
      dataService.once("ready", () => {
        waitForProvider();
      });
    }

    // Cleanup listener on unmount
    return () => {
      console.log(`Removing listener for sp-data/4sp/${onboardingId}`);
      dataService.off(`sp-data/4sp/${onboardingId}`, handleDataResponse);
    };
  }, [onboardingId]);


  // Get the modules and learning path info from the data
  const modules = data?.modules;
  // const learningPathInfo = data?.learningPath;

  // State to manage the visibility of the CoursesBoard popup
  const [isCoursesBoardVisible, setIsCoursesBoardVisible] = useState(false);

  // State to manage the selected training object
  const [selectedTraining, setSelectedTraining] = useState<string>();

  // Ref to manage the popup element
  const popupRef = useRef<HTMLDivElement>(null);

  // Handle click outside of the popup to close it
  const handleClickOutside = (event: MouseEvent): void => {
    if (popupRef.current && !popupRef.current.contains(event.target as Node)) {
      setIsCoursesBoardVisible(false);
    }
  };

  // Effect to add/remove the event listener based on the popup state
  useEffect(() => {
    if (isCoursesBoardVisible) {
      document.addEventListener('mousedown', handleClickOutside);
    } else {
      document.removeEventListener('mousedown', handleClickOutside);
    }
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [isCoursesBoardVisible]);


  // Function to handle the click on training data, which opens the CoursesBoard popup and sets the selected training object
  const handleTrainingDataClick = async (trainingObject: string): Promise<void> => {
    if (isCoursesBoardVisible) {
      setIsCoursesBoardVisible(!isCoursesBoardVisible);
      return;
    }
    try {
      setSelectedTraining(trainingObject);
      setIsCoursesBoardVisible(true);

    } catch (error) {
      console.error('Overall error in fetchCourseDetails:', error);
    }
  };


  let percentageCompleteSum = 0;
  //Function to get unique rows based on course or Code
  const uniqueRows = modules?.reduce((acc: CourseRow[], item: { course?: string; Code?: string; coursePercentageComplete?: number; isOptional?: boolean }) => {

    // Check if the item has an empty Code
    const hasEmptyCode = modules.some((module: { Code?: string }) => module.Code === '');

    // If the item has an empty Code, use course as the unique identifier
    // Otherwise, use Code as the unique identifier
    if (hasEmptyCode) {
      const exists = acc.find((i) => i.course === item.course);
      if (!exists && item.course) {
        acc.push({
          course: item.course,
          coursePercentageComplete: item.coursePercentageComplete ?? 0
        });

        // If the item is not optional, add its percentage to the sum
        if (!item.isOptional) {
          percentageCompleteSum += item.coursePercentageComplete ?? 0;
        }
      }
    } else {
      const exists = acc.find((i) => i.Code === item.Code);
      if (!exists && item.Code) {
        acc.push({
          course: item.course,
          Code: item.Code,
          coursePercentageComplete: item.coursePercentageComplete ?? 0
        });
        if (!item.isOptional) {
          percentageCompleteSum += item.coursePercentageComplete ?? 0;
        }
      }
    }
    return acc;
  }, []);

  let percentageCompleteAverage = 0

  // Calculate the average percentage complete
  if (uniqueRows) {
    percentageCompleteAverage = percentageCompleteSum / Object.entries(uniqueRows).length;
  }

  return (
    <>
      {/* Loading spinner */}
      {!data ? (
        <div className="flex justify-center items-center h-full w-full">
          <button disabled type="button" className="text-white bg-[#41273c]  hover:bg-[#896f85] hover:text-white focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center me-2 dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800 inline-flex items-center">
            <svg aria-hidden="true" role="status" className="inline w-4 h-4 me-3 text-white animate-spin" viewBox="0 0 100 101" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M100 50.5908C100 78.2051 77.6142 100.591 50 100.591C22.3858 100.591 0 78.2051 0 50.5908C0 22.9766 22.3858 0.59082 50 0.59082C77.6142 0.59082 100 22.9766 100 50.5908ZM9.08144 50.5908C9.08144 73.1895 27.4013 91.5094 50 91.5094C72.5987 91.5094 90.9186 73.1895 90.9186 50.5908C90.9186 27.9921 72.5987 9.67226 50 9.67226C27.4013 9.67226 9.08144 27.9921 9.08144 50.5908Z" fill="#E5E7EB" />
              <path d="M93.9676 39.0409C96.393 38.4038 97.8624 35.9116 97.0079 33.5539C95.2932 28.8227 92.871 24.3692 89.8167 20.348C85.8452 15.1192 80.8826 10.7238 75.2124 7.41289C69.5422 4.10194 63.2754 1.94025 56.7698 1.05124C51.7666 0.367541 46.6976 0.446843 41.7345 1.27873C39.2613 1.69328 37.813 4.19778 38.4501 6.62326C39.0873 9.04874 41.5694 10.4717 44.0505 10.1071C47.8511 9.54855 51.7191 9.52689 55.5402 10.0491C60.8642 10.7766 65.9928 12.5457 70.6331 15.2552C75.2735 17.9648 79.3347 21.5619 82.5849 25.841C84.9175 28.9121 86.7997 32.2913 88.1811 35.8758C89.083 38.2158 91.5421 39.6781 93.9676 39.0409Z" fill="currentColor" />
            </svg>
            Loading...
          </button>
        </div>
      ) : (
        <div className="relative mt-[40px]">
          {/* Popup showing the CoursesBoard component */}
          {isCoursesBoardVisible && (
            <div className="fixed inset-0 flex justify-center items-center bg-gray-800 bg-opacity-50 z-50" onClick={() => setIsCoursesBoardVisible(false)} >
              <CoursesBoard
                ref={popupRef}
                modules={modules || []}
                selectedTraining={selectedTraining}
                hasEmptyCode={modules?.some((module: { Code?: string }) => module.Code === '')}
              /></div>
          )}
          <div className='w-full max-w-[960px] mx-auto'>


            {/* Main Content */}
            <div className='flex justify-between items-start w-[960px] h-[300px] rounded-3xl outline outline-1 outline-offset-[-1px] outline-stone-700  '>
              {/* Left Side - Title and Courses */}
              <div className="h-[240px] w-[446px] space-y-[38px] pl-10 pt-8">
                <div className="text-2xl font-semibold font-Poppins space-y-2">
                  <div className="w-80 h-8 justify-start text-[#ee0c5d] text-xl font-semibold font-Poppins">Your Onboarding Progress </div>
                  <div className="w-[501px] h-8 justify-center text-stone-700 text-lg font-light font-Poppins">Complete these courses to finish your onboarding</div>
                </div>
                <OnboardingListCourses uniqueCourses={uniqueRows || []} handleTrainingDataClick={handleTrainingDataClick} />
              </div>

              {/* Right Side - images and ProgressBar */}
              <div className="relative w-[410px] h-[290px] pr-8 pt-8">
                {/* images */}
                <div className='relative h-[300px] translate-x-[70px] '>
                  <svg width="266" height="265" viewBox="0 0 266 274" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                    <rect x="72.4458" y="32.6438" width="193.3" height="235.398" rx="53" transform="rotate(1.68579 72.4458 32.6438)" fill="url(#pattern0_57543_1131)" />
                    <rect y="115.719" width="61" height="52" fill="url(#pattern1_57543_1131)" />
                    <rect x="8.21411" y="1.35974" width="78.272" height="73.2562" transform="rotate(-0.998114 8.21411 1.35974)" fill="url(#pattern2_57543_1131)" />
                    <rect x="17" y="179.72" width="91" height="80" fill="url(#pattern3_57543_1131)" />
                    <rect width="22.6695" height="24.9874" transform="matrix(0.982225 0.187707 -0.182348 0.983234 56.5562 213.72)" fill="url(#pattern4_57543_1131)" />
                    <defs>
                      <pattern id="pattern0_57543_1131" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlinkHref="#image0_57543_1131" transform="matrix(0.00366886 0 0 0.00301534 -0.810653 -0.228769)" />
                      </pattern>
                      <pattern id="pattern1_57543_1131" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlinkHref="#image0_57543_1131" transform="matrix(0.011398 0 0 0.0133701 -5.88273 -1.51197)" />
                      </pattern>
                      <pattern id="pattern2_57543_1131" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlinkHref="#image0_57543_1131" transform="matrix(0.0083173 0 0 0.00889446 -0.637873 -0.962973)" />
                      </pattern>
                      <pattern id="pattern3_57543_1131" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlinkHref="#image0_57543_1131" transform="matrix(0.00764045 0 0 0.00869059 -3.94337 -1.58278)" />
                      </pattern>
                      <pattern id="pattern4_57543_1131" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlinkHref="#image1_57543_1131" transform="matrix(0.0032963 0 0 0.00296667 -0.472222 -0.311817)" />
                      </pattern>
                      <image id="image0_57543_1131" width="722" height="414" preserveAspectRatio="none" xlinkHref="data:image/jpeg;base64," />
                      <image id="image1_57543_1131" width="1500" height="581" preserveAspectRatio="none" xlinkHref="data:image/png;base64," />
                    </defs>
                  </svg>
                </div>
                {/* ProgressBar positioned on the corner */}
                <div className='absolute top-4 right-2 z-10 pt-[18px] pr-[46px]  rounded-full'>
                  {/* {uniqueRows} */}
                  <ProgressBar PercentageComplete={Math.round(percentageCompleteAverage)} />
                </div>
              </div>
            </div>

          </div>
        </div>
      )}
    </>

  );
};
export default SpFxWebpartOnboarding;
